desktopweb.customCSS:
/* PHONE NUMBER */


width: 223px;
height: 20px;

font-family: 'Gotham';
font-style: italic;
font-weight: 500;
font-size: 14px;
line-height: 20px;
/* identical to box height, or 143% */

letter-spacing: 0.08em;
text-transform: uppercase;
font-feature-settings: 'tnum' on, 'lnum' on;

/* Mora Blue */

color: #2C3D73;


/* Inside auto layout */

flex: none;
order: 0;
flex-grow: 0;

